(1, 7, 'BBCream - Kem Nn', 'CC Cream Thefaceshop Aqua UV Color Control Cream SPF50/PA++', 'CC-Cream-Thefaceshop-Aqua-UV-Color-Control-Cream-SPF50-PA--', 'Sau thnh cng ca Face It Aura Color Control Cream ra mt u nm nay, TFS va tung ra dng CC cream mi tinh ny vi kh nng vt bc hn', '<p><span style="font-size: small; font-family: arial, helvetica, sans-serif;"><strong>CC Cream Thefaceshop Aqua UV Color Control Cream SPF50/PA++</strong> - 440.000</span></p>\r\n<p><span style="font-size: small; font-family: arial, helvetica, sans-serif;">Trng Lng: 20g</span></p>\r\n<p><span style="font-size: small; font-family: arial, helvetica, sans-serif;">Sau th&agrave;nh c&ocirc;ng ca Face It Aura Color Control Cream ra mt u nm nay, TFS va tung ra d&ograve;ng <a title="CC Cream Thefaceshop Aqua UV Color Control Cream SPF50/PA++" href="/shop/BBCream---Kem-Nen/CC-Cream-Thefaceshop-Aqua-UV-Color-Control-Cream-SPF50-PA--">CC cream</a>&nbsp;mi tinh n&agrave;y vi kh nng vt bc hn:</span></p>\r\n<p><span style="font-size: small; font-family: arial, helvetica, sans-serif;">+ Chng nng SPF 50+ hn c kem chng nng hng ng&agrave;y bo v l&agrave;n da di nng mt tri.</span></p>\r\n<p><span style="font-size: small; font-family: arial, helvetica, sans-serif;">+ Chng thm nc gi&uacute;p gi lp trang im c ng&agrave;y d&agrave;i.</span></p>\r\n<p><span style="font-size: small; font-family: arial, helvetica, sans-serif;">+ C ch l&agrave;m m&aacute;t mi gi&uacute;p gim nhit cho da (gim nhit b mt n 2  C so vi nhit  c th) th&iacute;ch hp cho make up ban ng&agrave;y, thoi m&aacute;i ra nng m&agrave; kh&ocirc;ng lo da b bng r&aacute;t v&agrave; b tia UV tn c&ocirc;ng na.</span></p>\r\n<p><span style="font-size: small; font-family: arial, helvetica, sans-serif;">+ Chc nng c&acirc;n chnh m&agrave;u da, cho lp nn u m&agrave;u v&agrave; n&acirc;ng t&ocirc;ng da s&aacute;ng hn mt c&aacute;ch t nhi&ecirc;n. Cht kem khi &aacute;nh l&ecirc;n da s t ng chuyn m&agrave;u ph&ugrave; hp vi da bn, c&acirc;n bng nhng v&ugrave;ng s&aacute;ng ti tr&ecirc;n da v&agrave; che ph khuyt im.</span></p>', '2014_01_17_16_50_17-shopmyphamhan-CC_Thefaceshop_xanh.jpg', 440000, 'CCTFS02', -11, '0', 0, 12, '1', '1', '1', 1385538227),
(2, 7, 'BBCream - Kem Nn', 'Face it magic cover BB CREAM', 'Face-it-magic-cover-BB-CREAM', 'Bn c th tm thy ti sn phm FACE IT MAGIC COVER BB CREAM SPF20 PA++  Kem lt trang im a nng vi cng thc thng minh', '<p><span style="font-size: small; font-family: arial, helvetica, sans-serif;"><strong>FACE it Magic Cover BB Cream SPF20 PA</strong>++ (45ml)</span></p>\r\n<p><br /><span style="font-size: small; font-family: arial, helvetica, sans-serif;">Bn c&oacute; th t&igrave;m thy ti sn phm <a title="Face it magic cover BB Cream" href="/shop/BBCream---Kem-Nen/Face-it-magic-cover-BB-CREAM"><strong>FACE IT MAGIC COVER BB CREAM SPF20 PA++</strong></a> Kem l&oacute;t trang im a nng vi c&ocirc;ng thc th&ocirc;ng minh, cha c&aacute;c ht dng cht DNA c bao bc bi lp m&agrave;ng bo v s t ng k&iacute;ch hot v&agrave; thm thu cht chng oxy h&oacute;a (Vitamin C, E) v&agrave;o da khi da tip x&uacute;c vi &aacute;nh nng mt tri.</span></p>\r\n<p><span style="font-size: small; font-family: arial, helvetica, sans-serif;"> ng thi, nh th&agrave;nh phn Dolwoe v&agrave; L&ecirc; Rng trong sn phm gi&uacute;p l&agrave;m trng v&agrave; ngn nga c&aacute;c du hiu l&atilde;o h&oacute;a sm, duy tr&igrave; s ti s&aacute;ng v&agrave; rng r l&acirc;u d&agrave;i cho da.</span></p>\r\n<p>&nbsp;</p>\r\n<p><span class="fbPhotosPhotoCaption" data-ft="{"><img title="Face It Magic Cover BB Cream" src="http://thuylinhshop.com/Images_upload/images/1322575942_Magic_cover_BB_zpscbae24e3.jpg" alt="" />&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<a title="Face it magic cover BB Cream" href="/shop/BBCream---Kem-Nen/Face-it-magic-cover-BB-CREAM"><img title="Face It Magic Cover BB Cream" src="http://thuylinhshop.com/Images_upload/images/841_P_1350541180147.jpg" alt="" /></a></span></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', '2014_01_17_16_40_17-shopmyphamhan-Face-it-magic-cover-BB-CREAM.png', 300000, 'BBTFS04', -2, '1', 10, 3, '1', '1', '1', 1385538402),
(4, 3, 'BB Cream - CC Cream - Kem Nn', 'Red Bean BB Cream SPF 20 PA+ - BB Cream Skinfood Chit Xut u ', 'Red-Bean-BB-Cream-SPF-20-PA----BB-Cream-Skinfood-Chiet-Xuat-Dau-Do', 'y l dng sn phm BB Cream dnh cho da thng, da hn hp, vi  che ph cao cng mi thm nh nhng, dng cht tt, BB Cream u  l sn phm khng th thiu trong b su tp Skinfood.', '<p><span style="font-family: arial, helvetica, sans-serif; font-size: small;" data-mce-mark="1">&acirc;y l&agrave; d&ograve;ng sn phm BB Cream d&agrave;nh cho da thng, da hn hp, vi  che ph cao c&ugrave;ng m&ugrave;i thm nh nh&agrave;ng, dng cht tt, BB Cream u  l&agrave; sn phm kh&ocirc;ng th thiu trong b su tp Skinfood.</span></p>\r\n<p style="text-align: center;"><span style="font-family: arial, helvetica, sans-serif; font-size: small;" data-mce-mark="1"><img title="Red Bean BB Cream SPF 20 PA+ - BB Cream Skinfood Chit Xut u " src="/uploads/details/Products/img_prod/bb-dau-do.jpg" alt="Red Bean BB Cream SPF 20 PA+ - BB Cream Skinfood Chit Xut u " /></span></p>\r\n<p><br /><span style="font-family: arial, helvetica, sans-serif; font-size: small;">Red Bean BB Cream SPF 20 PA+ lng hn so vi c&aacute;c BB kh&aacute;c n&ecirc;n khi d&ugrave;ng, n&oacute; to mt lp kh&aacute; mng tr&ecirc;n b mt da, b&ecirc;n cnh kh nng chng nng, BB u  c&oacute; mt c im na l&agrave; kh&ocirc;ng b xung m&agrave;u sau thi gian d&agrave;i make up.</span></p>', '2014_01_17_16_26_24-shopmyphamhan-bb-dau-do-1.jpg', 240000, 'BBSF007', -3, '0', 0, 4, '1', '1', '1', 1385640330);
